import styled from 'styled-components';

export const Container = styled.div`
  max-width: 100%;
  max-height: 100%;
  background: #FFCFCD;
  display: flex;
  justify-content: center;
  align-items: center;

  form {
    padding: 50px 50px 20px 50px;
    background: #FFFFFF;
  }
`;
